import React from "react";

import HomeText from './HomeText';
import NavBar from './NavBar';
const HomePage = () => {
    return (
        <div className="bg-cover bg-center h-screen" style={{ backgroundImage: "url('https://cdn.discordapp.com/attachments/749121374127128606/1174465874879590500/gym2.jpg?ex=6567b195&is=65553c95&hm=569e1e5029999b1adc8f3fa54d3ab99b277616e291b9f1f75f9b8492e41465d3&')" }}>
            <NavBar /> 
            <HomeText/>
        </div>
    );
};

export default HomePage;
